const { Row, Col } = require("react-bootstrap");
import Tweet from './'

function TweetsList(props) {
  const tweets = props.tweets;
  return (
    <div className="justify-content-center">
      {tweets.map((tweet) => (
        <Tweet text={tweet.text} username={tweet.username}></Tweet>
      ))}

    </div>
  );
}

export default TweetsList;
